import React from 'react';
import s from './GoUpButton.module.css';
import goUpImg from '../../../img/goUpImg.png'

export const GoUpButton = ({scroll, handleUpButton}) => {
   return (
      <button className={ scroll > 300 ? s.goUpButton + ' ' + s.showGoUp : s.goUpButton } onClick={handleUpButton}>
      <img src={goUpImg} />
       <br/>Go Up</button>
   )

}
export default GoUpButton;
